  const size = props.size || '100'
  const classId = props.classId || ''

  function camelCase(str) {
    let strSplit = str.toLowerCase().split(' ')
    if (strSplit.length === 1) {
      return strSplit[0]
    }
    for (let i = 1; i < strSplit.length; i++) {
      strSplit[i] = strSplit[i].charAt(0).toUpperCase() + strSplit[i].slice(1).toLowerCase();
    }
    return strSplit.join('')
  }

  return (
    <svg
      viewBox={props.viewBox ? props.viewBox : '0 0 32 32'}
      style={{
        // color: "inherit",
        strokeWidth: 0,
        stroke: "currentColor",
        fill: "currentColor"
      }}
      // width={`${size}px`}
      // height={`${size}px`}
      className={classId}
    >
      <path
        d={icons[camelCase(props.icon)]}
        style={{color: "inherit"}}
      ></path>
    </svg>
  )
